import React, { Component } from "react";
import { Navbar, Dropdown } from "rsuite";
class Nav extends Component {
  state = {};
  render() {
    return (
      <div>
        {" "}
        <Navbar>
          <Navbar.Header>
            <a href="#" className="navbar-brand logo">
              RSUITE
            </a>
          </Navbar.Header>
          <Navbar.Body>
            <Nav pullRight>
              <Nav.Item>Settings</Nav.Item>
            </Nav>
          </Navbar.Body>
        </Navbar>
      </div>
    );
  }
}

export default Nav;
